@jsnscrape:
Nope. It is for JeppView/Flightdeck only.

You might search the net for a program suite called AviaDBM (costs about 75$ and worth every penny IMHO) that takes your new database file (which you can download in encrypted form at the Garmin website), decrypts it and sends it to your handheld Garmin GPS (and much more). I use it to keep my old GPS90 (for which Garmin doesn't do updates any more because if its small memory) up to date with a shrinked database.

